$(document).ready(function () {

    let trending = [
        ['data:image/jpeg;base64,', 'Santorini', 'Greece', 'It may be a common tourist destination, but nothing beats holidaying on the beautiful island of Santorini in Greece.'],
        ['data:image/jpeg;base64,', 'Amalfi Coast', 'Italy', 'Sheer cliffs, a rugged shoreline dotted with small beaches, and charming pastel-coloured fishing villages make the Amalfi Coast an outstanding example of a Mediterranean landscape.'],
        ['data:image/jpeg;base64,', 'Chamonix', 'France', 'Chamonix, which is formally known as Chamonix Mont-Blanc, is a high-mountain town and resort area in the French Alps.'],
        ['data:image/jpeg;base64,', 'Antarctica', '', 'The continent may be freezing cold, but its also breathtakingly beautiful and a stunning sight to behold.'],
        ['data:image/jpeg;base64,', 'Arashiyama Bamboo Forest', 'Japan', 'The incredible Arashiyama Bamboo Forest in Japan is beloved by its many visitors.'],
        ['data:image/jpeg;base64,', 'Bagan', 'Myanmar', 'Located in central Myanmar, Bagan is an archaeological area and ancient city.'],
        ['data:image/jpeg;base64,', 'Venice', 'Italy', 'Of all the magnificent cities in the world, Venice is one of the most beautiful.'],
    ];
    

        for (i = 0; i < trending.length; i++) {
            var mname = trending[i][1];
            var place = trending[i][2];
            var des = trending[i][3];
            var images = trending[i][0];
                
         
            $(` <div class="card-body">
            <div class="card" style="background: url(${images});background-position: center;background-size: cover;"></div>
            <p class="cardhead">${mname},<br><span>${place}</span></p> 
            <p class="carddes">${des}</p> 
        </div>`).appendTo('#cards');
            
        }
  

});